import React, { useState } from 'react';
import { Menu, X, ChevronRight, Search, Star, Users, BookOpen } from 'lucide-react';

const HomePage = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [activeCard, setActiveCard] = useState(null);

  const features = [
    {
      icon: <Star className="w-8 h-8 text-yellow-500" />,
      title: "Discover Projects",
      description: "Browse through innovative ideas and find projects that inspire you to contribute and grow.",
      stats: "1,000+ Active Projects"
    },
    {
      icon: <Users className="w-8 h-8 text-blue-500" />,
      title: "Collaborate with Visionaries",
      description: "Connect with like-minded individuals to transform ideas into reality.",
      stats: "5,000+ Collaborators"
    },
    {
      icon: <BookOpen className="w-8 h-8 text-green-500" />,
      title: "Learn and Build",
      description: "Join projects to gain hands-on experience and expand your skills.",
      stats: "200+ Learning Paths"
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-100">
      {/* Header */}
      <header className="relative bg-gradient-to-r from-purple-600 to-indigo-600">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            {/* Logo */}
            <div className="flex-shrink-0">
              <h1 className="text-2xl font-bold text-white">
                Collab<span className="text-yellow-300">Sphere</span>
              </h1>
            </div>

            {/* Desktop Navigation */}
            <nav className="hidden md:block">
              <div className="flex space-x-6">
                {['Browse Projects', 'Login', 'Sign Up', 'About'].map((item) => (
                  <button
                    key={item}
                    className="text-white hover:text-yellow-300 transition-colors duration-200 px-3 py-2 rounded-md text-sm font-medium"
                  >
                    {item}
                  </button>
                ))}
              </div>
            </nav>

            {/* Mobile menu button */}
            <div className="md:hidden">
              <button
                onClick={() => setIsMenuOpen(!isMenuOpen)}
                className="text-white hover:text-yellow-300 p-2"
              >
                {isMenuOpen ? <X className="h-6 w-6" /> : <Menu className="h-6 w-6" />}
              </button>
            </div>
          </div>

          {/* Mobile Navigation */}
          {isMenuOpen && (
            <div className="md:hidden py-2">
              {['Browse Projects', 'Login', 'Sign Up', 'About'].map((item) => (
                <button
                  key={item}
                  className="block text-white hover:text-yellow-300 px-3 py-2 w-full text-left text-sm font-medium"
                >
                  {item}
                </button>
              ))}
            </div>
          )}
        </div>

        {/* Hero Section */}
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-24">
          <div className="text-center">
            <h2 className="text-4xl tracking-tight font-extrabold text-white sm:text-5xl md:text-6xl">
              Where ideas take flight
            </h2>
            <p className="mt-3 max-w-md mx-auto text-base text-indigo-100 sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
              Join our community of innovators, creators, and problem-solvers.
            </p>
            <div className="mt-8 flex justify-center">
              <div className="rounded-md shadow">
                <button className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-indigo-50 md:py-4 md:text-lg md:px-10">
                  Get Started <ChevronRight className="ml-2 h-5 w-5" />
                </button>
              </div>
            </div>
          </div>
        </div>
      </header>

      {/* Search Section */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 -mt-8">
        <div className="relative">
          <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
            <Search className="h-5 w-5 text-gray-400" />
          </div>
          <input
            type="text"
            className="block w-full pl-10 pr-3 py-4 border border-gray-300 rounded-lg leading-5 bg-white shadow-lg focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
            placeholder="Search for projects, collaborators, or skills..."
          />
        </div>
      </div>

      {/* Features Grid */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div className="grid gap-8 md:grid-cols-3">
          {features.map((feature, index) => (
            <div
              key={index}
              className={`relative bg-white rounded-xl shadow-lg p-6 transition-all duration-300 transform hover:-translate-y-1 hover:shadow-xl ${
                activeCard === index ? 'ring-2 ring-indigo-500' : ''
              }`}
              onMouseEnter={() => setActiveCard(index)}
              onMouseLeave={() => setActiveCard(null)}
            >
              <div className="flex flex-col items-center text-center">
                <div className="p-3 bg-gray-50 rounded-full">
                  {feature.icon}
                </div>
                <h3 className="mt-4 text-xl font-semibold text-gray-900">
                  {feature.title}
                </h3>
                <p className="mt-2 text-gray-500">
                  {feature.description}
                </p>
                <div className="mt-4 text-sm font-medium text-indigo-600">
                  {feature.stats}
                </div>
              </div>
            </div>
          ))}
        </div>
      </main>

      {/* Footer */}
      <footer className="bg-gray-900">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
          <div className="text-center">
            <p className="text-base text-gray-400">
              Â© {new Date().getFullYear()} CollabSphere. All rights reserved.
            </p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
